package dto;import java.util.List;public class User {    private String name;    private int age;    private List<Car> cars;    public String getName() {        return name;    }    public int getAge() {        return age;    }    public List<Car> getCars() {        return cars;    }    public void setName(String name) {        this.name = name;    }    public void setAge(int age) {        this.age = age;    }    public void setCars(List<Car> cars) {        this.cars = cars;    }    @Override    public String toString() {        return "User{" +                "name='" + name + '\'' +                ", age=" + age +                ", cars=" + cars +                '}';    }}